ControlPropertyState.AutoRuleBindingString:
If(
    IsBlank(
        LookUp(
            Filter(
                Filter(
                    'Stock Transfer Lines',
                    'Transfer Order No'.'Stock Transfer Header' exactin varGatePassHeader.headerGUID
                ),
                IsToday('Created On')
            ),
            'Transfer accepted' = 'Transfer accepted (Stock Transfer Lines)'.No
        )
    ),
    false,
    true
)
